pragma solidity >=0.4.23 <0.6.0;

contract Hyper {
    
    struct User {
        uint id;
        address referrer;
        uint partnersCount;
        address beneficiery;
        
        mapping(uint8 => bool) activeX3Levels;
        mapping(uint8 => bool) activeX6Levels;
        
        mapping(uint8 => X3) x3Matrix;
        mapping(uint8 => X6) x6Matrix;
    }
    
    struct X3 {
        address currentReferrer;
        address[] referrals;
        bool blocked;
        uint reinvestCount;
    }
    
    struct X6 {
        address currentReferrer;
        address[] firstLevelReferrals;
        address[] secondLevelReferrals; 
        bool blocked; 
        uint reinvestCount; 

        address closedPart; 
    }

    uint8 public constant LAST_LEVEL = 10; 
    
    mapping(address => User) public users; 
    mapping(uint => address) public idToAddress; 
    mapping(address => uint) public balances; 

    uint public lastUserId = 2; 
    address public owner; 

    
    mapping(uint8 => uint) public levelPrice;
    
    event Registration(address indexed user, address indexed referrer, uint indexed userId, uint referrerId);
    event Upgrade(address indexed user, address indexed referrer, uint8 matrix, uint8 level);
    
    event Reinvest(address indexed user, address indexed currentReferrer, address indexed caller, uint8 matrix, uint8 level, uint count);
    event NewUserPlace(address indexed user, address indexed referrer,uint id, uint8 matrix, uint8 level, uint8 place, uint count, bool ispartner);
    
    event MissedEthReceive(address indexed receiver, address indexed from,uint id, uint8 matrix, uint8 level, uint count);
    event SentExtraEthDividends(address indexed from, address indexed receiver,uint id, uint8 matrix, uint8 level,uint count);
    event BeneficieryChanged(address indexed oldaddress, address indexed newaddress, uint userId);

    
    constructor(address ownerAddress) public {
         
        levelPrice[1]   = 0.025 ether;
        levelPrice[2]   = 0.050 ether;
        levelPrice[3]   = 0.075 ether;
        levelPrice[4]   = 0.100 ether;
        levelPrice[5]   = 0.500 ether;
        levelPrice[6]   = 1.000 ether;
        levelPrice[7]   = 1.500 ether;
        levelPrice[8]   = 2.000 ether;
        levelPrice[9]   = 2.500 ether;
        levelPrice[10]  = 3.000 ether;
       
         owner = ownerAddress;

      
        
        User memory user = User({
            id: 1,
            referrer: address(0),
            partnersCount: uint(0),
            beneficiery: ownerAddress
        });
        
        users[ownerAddress] = user;
        idToAddress[1] = ownerAddress;
        
        for (uint8 i = 1; i <= LAST_LEVEL; i++) {
            users[ownerAddress].activeX3Levels[i] = true;
            users[ownerAddress].activeX6Levels[i] = true;
        }
        
        
              
    }
    
   
    
    function() external payable {
        if(msg.data.length == 0) {
            return registration(msg.sender, owner, 0xdD870fA1b7C4700F2BD7f44238821C26f7392148, 10000000000000000);
        }
        
        registration(msg.sender, bytesToAddress(msg.data), 0xdD870fA1b7C4700F2BD7f44238821C26f7392148, 10000000000000000);
    }

    function registrationExt(address referrerAddress, address payable _tds_addr, uint _amount) external payable {
        registration(msg.sender, referrerAddress, _tds_addr,_amount);
    }
    
    function buyNewLevel(uint8 matrix, uint8 level, address payable _tds_addr, uint _amount) external payable {
        require(isUserExists(msg.sender), "user is not exists. Register first.");
        require(matrix == 1 || matrix == 2, "invalid matrix");
        require(msg.value == levelPrice[level], "invalid price");
        require(level > 1 && level <= LAST_LEVEL, "invalid level");

        if (matrix == 1) {
            require(!users[msg.sender].activeX3Levels[level], "level already activated");

            if (users[msg.sender].x3Matrix[level-1].blocked) {
                users[msg.sender].x3Matrix[level-1].blocked = false;
            }
    
            address freeX3Referrer = findFreeX3Referrer(msg.sender, level);
            users[msg.sender].x3Matrix[level].currentReferrer = freeX3Referrer;
            users[msg.sender].activeX3Levels[level] = true;
            updateX3Referrer(msg.sender, freeX3Referrer, level,_tds_addr,_amount);
            
            emit Upgrade(msg.sender, freeX3Referrer, 1, level);

        } else {
            require(!users[msg.sender].activeX6Levels[level], "level already activated"); 

            if (users[msg.sender].x6Matrix[level-1].blocked) {
                users[msg.sender].x6Matrix[level-1].blocked = false;
            }

            address freeX6Referrer = findFreeX6Referrer(msg.sender, level);
            
            users[msg.sender].activeX6Levels[level] = true;
            updateX6Referrer(msg.sender, freeX6Referrer, level,_tds_addr,_amount);
            
            emit Upgrade(msg.sender, freeX6Referrer, 2, level);
        }
    }    
    
    function registration(address userAddress, address referrerAddress, address payable _tds_addr, uint _amount) private  {
        require(msg.value == 0.05 ether, "registration cost 0.05");
        require(!isUserExists(userAddress), "user exists");
        require(isUserExists(referrerAddress), "referrer not exists");
        
        uint32 size;
        assembly {
            size := extcodesize(userAddress)
        }
        require(size == 0, "cannot be a contract");
        
        User memory user = User({
            id: lastUserId,
            referrer: referrerAddress,
            partnersCount: 0,
            beneficiery:userAddress
        });
        
        users[userAddress] = user;
        idToAddress[lastUserId] = userAddress;
        
        users[userAddress].referrer = referrerAddress;
        
        users[userAddress].activeX3Levels[1] = true; 
        users[userAddress].activeX6Levels[1] = true;
        
        
       
        lastUserId++;
        
        users[referrerAddress].partnersCount++;

        address freeX3Referrer = findFreeX3Referrer(userAddress, 1);
        users[userAddress].x3Matrix[1].currentReferrer = freeX3Referrer;
        updateX3Referrer(userAddress, freeX3Referrer, 1,_tds_addr,_amount);

        updateX6Referrer(userAddress, findFreeX6Referrer(userAddress, 1), 1,_tds_addr,_amount);
        
        emit Registration(userAddress, referrerAddress, users[userAddress].id, users[referrerAddress].id);
    }
    
    function updateX3Referrer(address userAddress, address referrerAddress, uint8 level, address payable _tds_addr, uint _amount) private {
        users[referrerAddress].x3Matrix[level].referrals.push(userAddress);

        if (users[referrerAddress].x3Matrix[level].referrals.length < 3) {
            
            emit NewUserPlace(userAddress, referrerAddress,users[userAddress].id, 1, level, uint8(users[referrerAddress].x3Matrix[level].referrals.length),users[referrerAddress].x3Matrix[level].reinvestCount ,isPartner(userAddress,referrerAddress));
            return sendETHDividends(referrerAddress, userAddress, 1, level,_tds_addr,_amount);
        }
        
        emit NewUserPlace(userAddress, referrerAddress,users[userAddress].id , 1, level, 3, users[referrerAddress].x3Matrix[level].reinvestCount,isPartner(userAddress,referrerAddress));
        //close matrix
        users[referrerAddress].x3Matrix[level].referrals = new address[](0);
        if (!users[referrerAddress].activeX3Levels[level+1] && level != LAST_LEVEL) {
            users[referrerAddress].x3Matrix[level].blocked = true;
        }

        //create new one by recursion
        if (referrerAddress != owner) {
            //check referrer active level
            address freeReferrerAddress = findFreeX3Referrer(referrerAddress, level);
            if (users[referrerAddress].x3Matrix[level].currentReferrer != freeReferrerAddress) {
                users[referrerAddress].x3Matrix[level].currentReferrer = freeReferrerAddress;
            }
            
            users[referrerAddress].x3Matrix[level].reinvestCount++;
            emit Reinvest(referrerAddress, freeReferrerAddress, userAddress, 1, level, users[referrerAddress].x3Matrix[level].reinvestCount);
            updateX3Referrer(referrerAddress, freeReferrerAddress, level,_tds_addr,_amount);
        } else {
            sendETHDividends(owner, userAddress, 1, level,_tds_addr,_amount);
            users[owner].x3Matrix[level].reinvestCount++;
            emit Reinvest(owner, address(0), userAddress, 1, level, users[owner].x3Matrix[level].reinvestCount);
        }
    }

    function updateX6Referrer(address userAddress, address referrerAddress, uint8 level,address payable _tds_addr, uint _amount) private {
        require(users[referrerAddress].activeX6Levels[level], "500. Referrer level is inactive");
        
        if (users[referrerAddress].x6Matrix[level].firstLevelReferrals.length < 2) {
            users[referrerAddress].x6Matrix[level].firstLevelReferrals.push(userAddress);
            emit NewUserPlace(userAddress, referrerAddress,users[userAddress].id, 2, level, uint8(users[referrerAddress].x6Matrix[level].firstLevelReferrals.length), users[referrerAddress].x6Matrix[level].reinvestCount,isPartner(userAddress,referrerAddress));
            
            //set current level
            users[userAddress].x6Matrix[level].currentReferrer = referrerAddress;

            if (referrerAddress == owner) {
                return sendETHDividends(referrerAddress, userAddress, 2, level, _tds_addr,_amount);
            }
            
            address ref = users[referrerAddress].x6Matrix[level].currentReferrer;            
            users[ref].x6Matrix[level].secondLevelReferrals.push(userAddress); 
            
            uint len = users[ref].x6Matrix[level].firstLevelReferrals.length;
            
            if ((len == 2) && 
                (users[ref].x6Matrix[level].firstLevelReferrals[0] == referrerAddress) &&
                (users[ref].x6Matrix[level].firstLevelReferrals[1] == referrerAddress)) {
                if (users[referrerAddress].x6Matrix[level].firstLevelReferrals.length == 1) {
                    emit NewUserPlace(userAddress, ref,users[userAddress].id, 2, level, 5, users[ref].x6Matrix[level].reinvestCount,isPartner(userAddress,ref));
                } else {
                       emit NewUserPlace(userAddress, ref,users[userAddress].id, 2, level, 6,users[ref].x6Matrix[level].reinvestCount,isPartner(userAddress,ref));
                }
            }  else if ((len == 1 || len == 2) &&
                    users[ref].x6Matrix[level].firstLevelReferrals[0] == referrerAddress) {
                if (users[referrerAddress].x6Matrix[level].firstLevelReferrals.length == 1) {
                    emit NewUserPlace(userAddress, ref,users[userAddress].id, 2, level, 3,users[ref].x6Matrix[level].reinvestCount,isPartner(userAddress,ref));
                } else {
                    emit NewUserPlace(userAddress, ref,users[userAddress].id, 2, level, 4,users[ref].x6Matrix[level].reinvestCount,isPartner(userAddress,ref));
                }
            } else if (len == 2 && users[ref].x6Matrix[level].firstLevelReferrals[1] == referrerAddress) {
                if (users[referrerAddress].x6Matrix[level].firstLevelReferrals.length == 1) {
                    emit NewUserPlace(userAddress, ref,users[userAddress].id, 2, level, 5,users[ref].x6Matrix[level].reinvestCount,isPartner(userAddress,ref));
                } else {
                    emit NewUserPlace(userAddress, ref,users[userAddress].id, 2, level, 6,users[ref].x6Matrix[level].reinvestCount,isPartner(userAddress,ref));
                }
            }

            return updateX6ReferrerSecondLevel(userAddress, ref, level,_tds_addr,_amount);
        }
        
        users[referrerAddress].x6Matrix[level].secondLevelReferrals.push(userAddress);

        if (users[referrerAddress].x6Matrix[level].closedPart != address(0)) {
            if ((users[referrerAddress].x6Matrix[level].firstLevelReferrals[0] == 
                users[referrerAddress].x6Matrix[level].firstLevelReferrals[1]) &&
                (users[referrerAddress].x6Matrix[level].firstLevelReferrals[0] ==
                users[referrerAddress].x6Matrix[level].closedPart)) {

                updateX6(userAddress, referrerAddress, level, true);
                return updateX6ReferrerSecondLevel(userAddress, referrerAddress, level,_tds_addr,_amount);
            } else if (users[referrerAddress].x6Matrix[level].firstLevelReferrals[0] == 
                users[referrerAddress].x6Matrix[level].closedPart) {
                updateX6(userAddress, referrerAddress, level, true);
                return updateX6ReferrerSecondLevel(userAddress, referrerAddress, level,_tds_addr,_amount);
            } else {
                updateX6(userAddress, referrerAddress, level, false);
                return updateX6ReferrerSecondLevel(userAddress, referrerAddress, level,_tds_addr,_amount);
            }
        }

        if (users[referrerAddress].x6Matrix[level].firstLevelReferrals[1] == userAddress) {
            updateX6(userAddress, referrerAddress, level, false);
            return updateX6ReferrerSecondLevel(userAddress, referrerAddress, level,_tds_addr,_amount);
        } else if (users[referrerAddress].x6Matrix[level].firstLevelReferrals[0] == userAddress) {
            updateX6(userAddress, referrerAddress, level, true);
            return updateX6ReferrerSecondLevel(userAddress, referrerAddress, level,_tds_addr,_amount);
        }
        
        if (users[users[referrerAddress].x6Matrix[level].firstLevelReferrals[0]].x6Matrix[level].firstLevelReferrals.length <= 
            users[users[referrerAddress].x6Matrix[level].firstLevelReferrals[1]].x6Matrix[level].firstLevelReferrals.length) {
            updateX6(userAddress, referrerAddress, level, false);
        } else {
            updateX6(userAddress, referrerAddress, level, true);
        }
        
        updateX6ReferrerSecondLevel(userAddress, referrerAddress, level,_tds_addr,_amount);
    }

    function updateX6(address userAddress, address referrerAddress, uint8 level, bool x2) private {
        if (!x2) {
            users[users[referrerAddress].x6Matrix[level].firstLevelReferrals[0]].x6Matrix[level].firstLevelReferrals.push(userAddress);
            emit NewUserPlace(userAddress, users[referrerAddress].x6Matrix[level].firstLevelReferrals[0],users[userAddress].id, 2, level, uint8(users[users[referrerAddress].x6Matrix[level].firstLevelReferrals[0]].x6Matrix[level].firstLevelReferrals.length),users[users[referrerAddress].x6Matrix[level].firstLevelReferrals[0]].x6Matrix[level].reinvestCount,isPartner(userAddress,users[referrerAddress].x6Matrix[level].firstLevelReferrals[0]));
            emit NewUserPlace(userAddress, referrerAddress,users[userAddress].id, 2, level, 2 + uint8(users[users[referrerAddress].x6Matrix[level].firstLevelReferrals[0]].x6Matrix[level].firstLevelReferrals.length),users[referrerAddress].x6Matrix[level].reinvestCount,isPartner(userAddress,referrerAddress));
            //set current level
            users[userAddress].x6Matrix[level].currentReferrer = users[referrerAddress].x6Matrix[level].firstLevelReferrals[0];
        } else {
            users[users[referrerAddress].x6Matrix[level].firstLevelReferrals[1]].x6Matrix[level].firstLevelReferrals.push(userAddress);
            emit NewUserPlace(userAddress, users[referrerAddress].x6Matrix[level].firstLevelReferrals[1],users[userAddress].id, 2, level, uint8(users[users[referrerAddress].x6Matrix[level].firstLevelReferrals[1]].x6Matrix[level].firstLevelReferrals.length),users[users[referrerAddress].x6Matrix[level].firstLevelReferrals[1]].x6Matrix[level].reinvestCount,isPartner(userAddress,users[referrerAddress].x6Matrix[level].firstLevelReferrals[1]));
            emit NewUserPlace(userAddress, referrerAddress,users[userAddress].id, 2, level, 4 + uint8(users[users[referrerAddress].x6Matrix[level].firstLevelReferrals[1]].x6Matrix[level].firstLevelReferrals.length),users[referrerAddress].x6Matrix[level].reinvestCount,isPartner(userAddress,referrerAddress));
            //set current level
            users[userAddress].x6Matrix[level].currentReferrer = users[referrerAddress].x6Matrix[level].firstLevelReferrals[1];
        }
    }
    
    function updateX6ReferrerSecondLevel(address userAddress, address referrerAddress, uint8 level, address payable _tds_addr,uint _amount) private {
        if (users[referrerAddress].x6Matrix[level].secondLevelReferrals.length < 4) {
            return sendETHDividends(referrerAddress, userAddress, 2, level,_tds_addr,_amount);
        }
        
        address[] memory x6 = users[users[referrerAddress].x6Matrix[level].currentReferrer].x6Matrix[level].firstLevelReferrals;
        
        if (x6.length == 2) {
            if (x6[0] == referrerAddress ||
                x6[1] == referrerAddress) {
                users[users[referrerAddress].x6Matrix[level].currentReferrer].x6Matrix[level].closedPart = referrerAddress;
            } else if (x6.length == 1) {
                if (x6[0] == referrerAddress) {
                    users[users[referrerAddress].x6Matrix[level].currentReferrer].x6Matrix[level].closedPart = referrerAddress;
                }
            }
        }
        
        users[referrerAddress].x6Matrix[level].firstLevelReferrals = new address[](0);
        users[referrerAddress].x6Matrix[level].secondLevelReferrals = new address[](0);
        users[referrerAddress].x6Matrix[level].closedPart = address(0);

        if (!users[referrerAddress].activeX6Levels[level+1] && level != LAST_LEVEL) {
            users[referrerAddress].x6Matrix[level].blocked = true;
        }

        users[referrerAddress].x6Matrix[level].reinvestCount++;
        
        if (referrerAddress != owner) {
            address freeReferrerAddress = findFreeX6Referrer(referrerAddress, level);

            emit Reinvest(referrerAddress, freeReferrerAddress, userAddress, 2, level, users[referrerAddress].x6Matrix[level].reinvestCount);
            updateX6Referrer(referrerAddress, freeReferrerAddress, level,_tds_addr,_amount);
        } else {
            emit Reinvest(owner, address(0), userAddress, 2, level, users[owner].x6Matrix[level].reinvestCount);
            sendETHDividends(owner, userAddress, 2, level,_tds_addr,_amount);
        }
    }
    
    function findFreeX3Referrer(address userAddress, uint8 level) public view returns(address) {
        while (true) {
            if (users[users[userAddress].referrer].activeX3Levels[level]) {
                return users[userAddress].referrer;
            }
            
            userAddress = users[userAddress].referrer;
        }
    }
    
    function findFreeX6Referrer(address userAddress, uint8 level) public view returns(address) {
        while (true) {
            if (users[users[userAddress].referrer].activeX6Levels[level]) {
                return users[userAddress].referrer;
            }
            
            userAddress = users[userAddress].referrer;
        }
    }
        
    function usersActiveX3Levels(address userAddress, uint8 level) public view returns(bool) {
        return users[userAddress].activeX3Levels[level];
    }

    function usersActiveX6Levels(address userAddress, uint8 level) public view returns(bool) {
        return users[userAddress].activeX6Levels[level];
    }

    function usersX3Matrix(address userAddress, uint8 level) public view returns(address, address[] memory, bool) {
        return (users[userAddress].x3Matrix[level].currentReferrer,
                users[userAddress].x3Matrix[level].referrals,
                users[userAddress].x3Matrix[level].blocked);
    }

    function usersX6Matrix(address userAddress, uint8 level) public view returns(address, address[] memory, address[] memory, bool, address) {
        return (users[userAddress].x6Matrix[level].currentReferrer,
                users[userAddress].x6Matrix[level].firstLevelReferrals,
                users[userAddress].x6Matrix[level].secondLevelReferrals,
                users[userAddress].x6Matrix[level].blocked,
                users[userAddress].x6Matrix[level].closedPart);
    }
    
    function isUserExists(address user) public view returns (bool) {
        return (users[user].id != 0);
    }
    
    function changeBeneficiery(address newBeneficiery) public {
        require(isUserExists(msg.sender), "user doesn't exist");
        emit BeneficieryChanged(users[msg.sender].beneficiery, newBeneficiery,users[msg.sender].id );
        users[msg.sender].beneficiery = newBeneficiery;
    }
    
    function isPartner(address user, address referrer) private view returns(bool) {
        return (users[user].referrer == referrer);
    }
    
    function findEthReceiver(address userAddress, address _from, uint8 matrix, uint8 level) private returns(address, bool) {
        address receiver = users[userAddress].beneficiery;
        bool isExtraDividends;
        if (matrix == 1) {
            while (true) {
                if (users[receiver].x3Matrix[level].blocked) {
                    emit MissedEthReceive(receiver, _from,users[_from].id, 1, level, users[receiver].x3Matrix[level].reinvestCount);
                    isExtraDividends = true;
                    receiver = users[users[receiver].x3Matrix[level].currentReferrer].beneficiery;
                } else {
                    return (receiver, isExtraDividends);
                }
            }
        } else {
            while (true) {
                if (users[receiver].x6Matrix[level].blocked) {
                    emit MissedEthReceive(receiver, _from,users[_from].id, 2, level,users[receiver].x6Matrix[level].reinvestCount);
                    isExtraDividends = true;
                    receiver = users[users[receiver].x6Matrix[level].currentReferrer].beneficiery;
                } else {
                    return (receiver, isExtraDividends);
                }
            }
        }
    }
    
    function sendETHDividends(address userAddress, address _from , uint8 matrix, uint8 level, address payable _tds_addr, uint _amount) private {
        (address receiver, bool isExtraDividends) = findEthReceiver(userAddress, _from, matrix, level);
          
            
             uint amount  ;
             
             if(level == 1){
                 amount = _amount/2;
             }else{
                 amount = _amount;
             }
       
        if (isExtraDividends) {
            if(matrix == 1){
                emit SentExtraEthDividends(_from, receiver,users[_from].id, matrix, level,users[receiver].x3Matrix[level].reinvestCount);
            }else if(matrix == 2){
                emit SentExtraEthDividends(_from, receiver,users[_from].id, matrix, level,users[receiver].x6Matrix[level].reinvestCount);
            }
            
        }
       
            if(amount > 0){
                address payable TDS_ADDRESS = _tds_addr;
                TDS_ADDRESS.transfer(amount);
            }
            
            return address(uint160(receiver)).transfer(levelPrice[level]-amount);
       
       
    }
    
    function bytesToAddress(bytes memory bys) private pure returns (address addr) {
        assembly {
            addr := mload(add(bys, 20))
        }
    }
}
